// SPDX-License-Identifier: MIT
pragma solidity 0.8.10;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ContextUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/access/AccessControlUpgradeable.sol";

import "./interfaces/IGnomes.sol";
import "./interfaces/IMine.sol";
import "./interfaces/IRandom.sol";
import "./interfaces/ICharacter.sol";
import "./interfaces/IToken.sol";


contract Mines is Initializable, ContextUpgradeable, ReentrancyGuardUpgradeable, AccessControlUpgradeable, IMine {

    bytes32 public constant CONTRACT_ROLE = keccak256("CONTRACT_ROLE");

    IToken private  _tokenContract;
    IGnomes private _gnomesContract;
    IRandom private _randomContract;
    ICharacter private _characterContract;
    structMine[] private _mines;
    uint32 private _productionMulti;
    uint32 private _gameFee;
    // account =>  collectionId => mineId
    mapping(address => mapping(uint8 => uint32)) private _playersInMines;
    // account => collectionId => timestamp
    mapping(address => mapping(uint8 => structInjuredCollection)) private _injuredCollections;

    event Mine(address indexed account, uint8 collectionId, uint32 mineId, uint timstamp);
    event Claim(address indexed account, uint8 collectionId, uint32 mineId);
    event MineCreated(uint mineId);

    function initialize(address tokenContract, address randomContract, address characterContract, address admin) public initializer {
        __ReentrancyGuard_init();
        __AccessControl_init();
        _grantRole(DEFAULT_ADMIN_ROLE, admin);
        _grantRole(DEFAULT_ADMIN_ROLE, _msgSender());
        setTokenContractAddress(tokenContract);
        setRandomContractAddress(randomContract);
        setCharacterContractAddress(characterContract);
        setGameFee(2000);
    }

    function mine(uint8 collectionId, uint32 mineId) external nonReentrant {
        require(_mines[mineId].exists, 'mine does not exists');
        require(_injuredCollections[_msgSender()][collectionId].startTime >= 1 hours, "the gnomes is injured");
        require(_playersInMines[_msgSender()][collectionId] == 0, 'the gnomes are mining');
        uint mineMaxPower = _mines[mineId].maxPower;
        uint attackerCollectionPower = _gnomesContract.getPlayerCollectionsPower(_msgSender(), collectionId);
        require(attackerCollectionPower > _mines[mineId].minPower, 'to weak');
        if (attackerCollectionPower > mineMaxPower) {
            attackerCollectionPower = mineMaxPower;
        }
        //if no one in the mine then just give it to the player
        if (_mines[mineId].miner.account == address(0)) {
            _removePlayerFormMine(_msgSender(), collectionId, mineId);
            _addPlayerToMine(_msgSender(), collectionId, mineId);
            return;
        }

        //fight for the mine
        structMiner memory defender = _mines[mineId].miner;

        uint defenderCollectionPower = _gnomesContract.getPlayerCollectionsPower(defender.account, defender.collectionId);
        if (defenderCollectionPower > mineMaxPower) {
            defenderCollectionPower = mineMaxPower;
        }
        if (defenderCollectionPower > attackerCollectionPower) {
            defenderCollectionPower = (defenderCollectionPower - attackerCollectionPower) * _mines[mineId].powerMulti + defenderCollectionPower;
        } else if (defenderCollectionPower < attackerCollectionPower) {
            attackerCollectionPower = (attackerCollectionPower - defenderCollectionPower) * _mines[mineId].powerMulti + attackerCollectionPower;
        }
        uint defenderRandomNumber = _randomContract.getRandomNumber();
        uint attackerRandomNumber = _randomContract.getRandomNumber();

        uint defenderPower = _characterContract.getAccountPower(defender.account) + defenderCollectionPower;
        uint attackerPower = _characterContract.getAccountPower(_msgSender()) + attackerCollectionPower;

        if ((attackerRandomNumber % attackerPower) > (defenderRandomNumber % defenderPower)) {
            //send the tokens to the previous player
            _injuredCollections[defender.account][defender.collectionId] = structInjuredCollection({
            startTime : block.timestamp,
            power : defenderPower
            });
            _playersInMines[defender.account][defender.collectionId] = 0;
            _addPlayerToMine(_msgSender(), collectionId, mineId);
            _mintTokensFromMine(defender.account, defender.startTime, uint(_mines[mineId].productionRate));
            emit Claim(defender.account, defender.collectionId, mineId);

        }
    }

    function heal(uint8 collectionId) external {
        uint cost = getHealingCost(_msgSender(), collectionId);
        require(cost > 0, "no need for heal");
        require(cost <= _tokenContract.balanceOf(_msgSender()), 'not enough tokens');
        _tokenContract.burn(_msgSender(), cost);
        _injuredCollections[_msgSender()][collectionId].startTime = 0;
        _injuredCollections[_msgSender()][collectionId].power = 0;

    }

    function getHealingCost(address account, uint8 collectionId) public view returns (uint) {
        uint injuredTime = _injuredCollections[account][collectionId].startTime;
        if (block.timestamp - injuredTime >= 1 hours) {
            return 0;
        }
        return _injuredCollections[account][collectionId].power * (10000 - (block.timestamp - injuredTime) * 10000 / 1 hours) / 10000;

    }

    function _mintTokensFromMine(address account, uint startTime, uint productionRate) private {
        uint amountToMint = (block.timestamp - startTime) * productionRate * _productionMulti;
        if (amountToMint > 0) {
            _tokenContract.mint(account, amountToMint);
            _tokenContract.mint(account, amountToMint * _gameFee / 10000);
        }

    }

    function _addPlayerToMine(address account, uint8 collectionId, uint32 mineId) private {

        _mines[mineId].miner.account = account;
        _mines[mineId].miner.collectionId = collectionId;
        _mines[mineId].miner.startTime = block.timestamp;

        _playersInMines[account][collectionId] = mineId;
        emit Mine(_msgSender(), collectionId, mineId, block.timestamp);
    }

    function _removePlayerFormMine(address account, uint8 collectionId, uint32 mineId) private {
        if (_mines[mineId].miner.account == account) {
            delete _mines[mineId].miner;
        }
        _playersInMines[account][collectionId] = 0;
    }

    function claim(uint32 mineId) external nonReentrant {

        _claim(_msgSender(), mineId);
    }

    function _claim(address account, uint32 mineId) private {
        if (_mines[mineId].miner.account != account) {
            return;
        }
        structMiner memory claimer = _mines[mineId].miner;
        _removePlayerFormMine(claimer.account, claimer.collectionId, mineId);
        _mintTokensFromMine(claimer.account, claimer.startTime, _mines[mineId].productionRate);
        emit Claim(account, claimer.collectionId, mineId);

    }

    function claimByAccount(address account, uint8 collectionId) external nonReentrant onlyRole(CONTRACT_ROLE) {
        uint32 mineId = _playersInMines[account][collectionId];
        if (mineId == 0) {
            return;
        }

        _claim(account, mineId);
    }

    function getMine(uint mineId) public view returns (structMine memory){
        return _mines[mineId];
    }



    //********************************* management functions *************************************//


    function setGnomesContractAddress(address gnomesContract) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _gnomesContract = IGnomes(gnomesContract);
    }

    function setTokenContractAddress(address tokenContract) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _tokenContract = IToken(tokenContract);
    }

    function setRandomContractAddress(address randomContract) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _randomContract = IRandom(randomContract);
    }

    function setCharacterContractAddress(address characterContract) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _characterContract = ICharacter(characterContract);

    }

    function buildMines(structMine[] memory mines) external nonReentrant onlyRole(DEFAULT_ADMIN_ROLE) {
        for (uint i; i < mines.length; i++) {
            mines[i].exists = true;
            _mines.push(mines[i]);
            emit MineCreated(_mines.length - 1);
        }
    }

    function setGameFee(uint32 fee) public nonReentrant onlyRole(DEFAULT_ADMIN_ROLE) {
        _gameFee = fee;
    }
}
